// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract UtilityContract {
  uint public walletId = 0;

  struct Wallet {
    string walletAddress;
    uint balance;
  }

  mapping (uint => Wallet) public wallets;

  constructor() public {
    createWallet(696969, "0x123456789");
  }

  function createWallet(uint _balance, string memory _walletAddress) public {
    walletId ++;
    wallets[walletId] = Wallet(_walletAddress, _balance);
  }
}
